import React, { useState } from 'react';
import styled from 'styled-components'

const BottonElement = styled.button`
    font-size: 20px;
    font-weight: 500
    letter-spacing: .25px;
    background-color: #8a0865;

`;

const Botton = (props) => (
    <BottonElement  {...props} >{props.name}</BottonElement>
);

export { Botton };
